actionConfiguration.body:
function (currentRow) {
  switch (PageLogic.TransformStatus(currentRow)) {
    case PageConstant.versionStatus.active:
      return PageConstant.style.color.versionStatus.active;
    case PageConstant.versionStatus.inactive:
      return PageConstant.style.color.versionStatus.inactive;
    case PageConstant.versionStatus.draft:
      return PageConstant.style.color.versionStatus.draft;
    default:
      return PageConstant.style.color.versionStatus.default;
  }
}
